    subspaces.sort((a, b) => a.length - b.length);
    const pointsData = subspaces.map((key) => ({
      key,
      points: jsonData[key] || [],
      dimensions: key.length,
      subspaceId: key,
    }));
    console.log("Points data:", pointsData.dimensions);
    const ringLabels = subspaces.map((_, i) => String.fromCharCode(65 + i));
    const pointPositions = {};


    const calculateProportionalAngles = () => {
      console.log("Starting calculateProportionalAngles...");
      console.log("pointsData:", pointsData);

      if (pointsData.length === 0) {
        console.error("No points data available");
        return [];
      }

      const lastRing = pointsData[pointsData.length - 1];
      const lastRingPoints = lastRing.points || [];
      const sectorsCount = Math.max(1, 2 ** pointsData.dimensions);

      console.log("Last ring:", lastRing);
      console.log("Last ring points length:", lastRingPoints.length);
      console.log("Sectors count:", sectorsCount);

      // Fallback for empty or invalid last ring
      if (lastRingPoints.length === 0 || !Number.isFinite(sectorsCount)) {
        console.warn("Invalid last ring data, using equal angles");
        return pointsData.map((_, i) => {
          const sectorCount = Math.max(1, 2 ** (i + 1));
          console.log(`Ring ${i} sector count: ${sectorCount}`);
          return Array(sectorCount).fill(2 * Math.PI / sectorCount);
        });
      }

      const pointCounts = new Array(sectorsCount).fill(0);
      console.log("Initialized pointCounts:", pointCounts);

      lastRingPoints.forEach((point, idx) => {
        const pointData = Object.entries(point).filter(([key]) => key !== "Point_ID");
        const bitVector = pointData.map(([_, coord]) => (coord >= 0 ? 1 : 0)).join("");
        const sectorIndex = parseInt(bitVector, 2);
        if (sectorIndex >= 0 && sectorIndex < sectorsCount) {
          pointCounts[sectorIndex]++;
        } else {
          console.warn(`Point ${idx}: Invalid sector index ${sectorIndex} for bitVector ${bitVector}`);
        }
      });

      console.log("Point counts per sector:", pointCounts);

      const minAngle = Math.PI / 180; // 1 degree minimum
      const totalAngle = 2 * Math.PI;
      const totalNonEmptyPoints = Math.max(0, pointCounts.reduce((sum, count) => sum + count, 0));
      const remainingAngle = totalAngle - (sectorsCount * minAngle);

      console.log("Total non-empty points:", totalNonEmptyPoints);
      console.log("Remaining angle:", remainingAngle);

      const sectorAngles = pointCounts.map((count, idx) => {
        const angle = count > 0
          ? (count / totalNonEmptyPoints) * remainingAngle
          : minAngle;
        console.log(`Sector ${idx} angle: ${angle}`);
        return angle;
      });

      console.log("Sector angles:", sectorAngles);

      // Propagate angles to inner rings
      const ringAngles = [sectorAngles];
      for (let i = pointsData.length - 2; i >= 0; i--) {
        const prevAngles = ringAngles[0];
        const sectorCount = Math.max(1, 2 ** (i + 1));
        if (!Number.isFinite(sectorCount)) {
          console.error(`Invalid sectorCount for ring ${i}: ${sectorCount}`);
          return []; 
        }
        console.log(`Ring ${i}, sectorCount: ${sectorCount}, isFinite: ${Number.isFinite(sectorCount)}`);

        const currAngles = new Array(sectorCount);
        console.log(`Propagating to ring ${i}, expected sectors: ${sectorCount}`);

        for (let j = 0; j < sectorCount; j++) {
          const angle1 = prevAngles[j * 2] || 0;
          const angle2 = prevAngles[j * 2 + 1] || 0;
          currAngles[j] = angle1 + angle2;
          console.log(`Ring ${i}, sector ${j}: ${currAngles[j]} (from ${angle1} + ${angle2})`);
        }
        ringAngles.unshift(currAngles);
      }

      console.log("Final ring angles:", ringAngles);
      return ringAngles;
    };

    const renderNormalView = () => {
      subspaces.forEach((key, index) => {
        if (!ringVisibility[key]) return;
        const innerRadius = (index / subspaces.length) * maxRadius;
        const outerRadius = ((index + 1) / subspaces.length) * maxRadius;
        const sectors = 2 ** (index + 1);
        const rotationOffset = Math.PI / 2;

        for (let i = 0; i < sectors; i++) {
          const startAngle = (2 * Math.PI * i) / sectors + rotationOffset;
          const endAngle = (2 * Math.PI * (i + 1)) / sectors + rotationOffset;

          g.append("path")
            .attr("d", d3.arc()
              .innerRadius(innerRadius)
              .outerRadius(outerRadius)
              .startAngle(startAngle)
              .endAngle(endAngle)
            )
            .attr("fill", getSectorColor(index, i))
            .attr("fill-opacity", 0.3)
            .attr("stroke", "black")
            .attr("stroke-width", 0.5)
            .style("cursor", "pointer");

          g.append("text")
            .attr("x", 0)
            .attr("y", -outerRadius - 5)
            .attr("text-anchor", "middle")
            .attr("font-size", "16px")
            .attr("fill", "red")
            .attr("font-weight", "bold")
            .text(ringLabels[index]);
        }
        renderPoints(index, innerRadius, outerRadius, sectors);
      });
    };

    const renderProportionalView = () => {
      const ringAngles = calculateProportionalAngles();
      console.log("Rendering proportional view with ringAngles:", ringAngles);

      if (!ringAngles || ringAngles.length !== pointsData.length || ringAngles.some(arr => !arr || !Array.isArray(arr))) {
        console.error("Invalid ring angles, falling back to normal view:", ringAngles);
        renderNormalView();
        return;
      }

      subspaces.forEach((key, index) => {
        if (!ringVisibility[key]) return;
        const innerRadius = (index / subspaces.length) * maxRadius;
        const outerRadius = ((index + 1) / subspaces.length) * maxRadius;
        let currentAngle = Math.PI / 2 - 90;

        ringAngles[index].forEach((angle, i) => {
          const startAngle = currentAngle;
          const endAngle = currentAngle + angle;

          g.append("path")
            .attr("d", d3.arc()
              .innerRadius(innerRadius)
              .outerRadius(outerRadius)
              .startAngle(startAngle)
              .endAngle(endAngle)
            )
            .attr("fill", getSectorColor(index, i))
            .attr("fill-opacity", 0.3)
            .attr("stroke", "black")
            .attr("stroke-width", 0.5)
            .style("cursor", "pointer");

          currentAngle = endAngle;
        });

        g.append("text")
          .attr("x", 0)
          .attr("y", -outerRadius - 5)
          .attr("text-anchor", "middle")
          .attr("font-size", "16px")
          .attr("fill", "red")
          .attr("font-weight", "bold")
          .text(ringLabels[index]);

        renderPoints(index, innerRadius, outerRadius, ringAngles[index]);
      });
    };

